--------------------------------------------------------
--  DDL for View DUPLICATION_ACC_BAL_VIEW
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE VIEW "TANFEETH"."DUPLICATION_ACC_BAL_VIEW" ("SRVC_REQST_COR_RN", "AGCY_SRVC_REQST_ID", "PROCESS_TYPE_CD", "SRVC_TYPE_CD", "REQSTR_CD", "GEO_LOC", "REQSTR_REF_NO", "ACC_NO") AS SELECT rqst.SRVC_REQST_COR_RN,rqst.AGCY_SRVC_REQST_ID,rqst.PROCESS_TYPE_CD,rqst.SRVC_TYPE_CD,rqst.REQSTR_CD,rqst.GEO_LOC,rqst.REQSTR_REF_NO,CASE  WHEN rqst.SRVC_TYPE_CD ='001'  THEN acc_rqst.ACC_NO  WHEN rqst.SRVC_TYPE_CD = '002' THEN bal_rqst.ACC_NO END as ACC_NO
FROM AGCY_SRVC_REQST rqst ,
  ACC_INFO_REQST acc_rqst,
  ACC_BAL_INFO_REQST bal_rqst
WHERE (rqst.AGCY_SRVC_REQST_ID = acc_rqst.AGCY_SRVC_REQST_ID(+)
AND rqst.AGCY_SRVC_REQST_ID    = bal_rqst.AGCY_SRVC_REQST_ID(+))
AND rqst.CURR_REQST_STATUS_CD not in('COM','CLOS','COMDE','RECIV','INCOM','INCOMDE','NOTDELIV') WITH READ ONLY
;
--------------------------------------------------------
--  DDL for View DUPLICATION_COMMON_VIEW
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE VIEW "TANFEETH"."DUPLICATION_COMMON_VIEW" ("SRVC_REQST_COR_RN", "AGCY_SRVC_REQST_ID", "PROCESS_TYPE_CD", "SRVC_TYPE_CD", "INQRD_PARTY_CD", "REQSTR_CD", "GEO_LOC", "REQSTR_REF_NO", "ID_NO", "ID_TYPE") AS SELECT /*+ index (AGCY_SRVC_REQST AGCY_SRVC_REQST_INDEX_DUP) */  rqst.SRVC_REQST_COR_RN,rqst.AGCY_SRVC_REQST_ID,rqst.PROCESS_TYPE_CD,rqst.SRVC_TYPE_CD,rqst.INQRD_PARTY_CD,rqst.REQSTR_CD,rqst.GEO_LOC,rqst.REQSTR_REF_NO,  
inv.ID_NO as ID_NO
,inv.ID_TYPE_CD as  ID_TYPE

FROM AGCY_SRVC_REQST rqst ,INVOLVED_PARTY inv

WHERE (rqst.AGCY_SRVC_REQST_ID = inv.AGCY_SRVC_REQST_ID
 )
AND rqst.CURR_REQST_STATUS_CD not in('COM','CLOS','COMDE','RECIV','INCOM','INCOMDE','NOTDELIV') WITH READ ONLY
;
--------------------------------------------------------
--  DDL for View SLA_TMPL_VIEW
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE VIEW "TANFEETH"."SLA_TMPL_VIEW" ("TMPL_CODE", "CYCLE", "CH_ID", "LVL", "COB_DUE_START", "SOB_DUE_CLOSE", "P7") AS SELECT
    ST.TMPL_CODE,
    ST.CYCLE,
    ST.CH_ID,
    ST.LVL,
    ST.COB_DUE_START,
    ST.SOB_DUE_CLOSE ,
    (ST.SOB_DUE - ST.SOB + GREATEST(trunc(sysdate,'MI'),ST.SOB)) AS P7
FROM
    SLA_TMPL ST
WHERE
    systimestamp >= ST.PRV_CLOSE
AND systimestamp <ST.COB
;
