XML_INPUT_STR VARCHAR2(2000);
te VARCHAR2(2000);
XML_INPUT_VAL XMLTYPE;

BEGIN

DBMS_OUTPUT.PUT_LINE('INSERT_EXEC_RUNNING_TOTAL_SP starts');
/*
<exec_Running_Totals>
	<exec_summary_id> </exec_summary_id>
	<fin_inst_cd> </fin_inst_cd>
	<acc_num> </acc_num>
	<acc_currency> </acc_currency>
	<available_amt> </available_amt>
	<creation_date> </creation_date>
</exec_Running_Totals>
 */

--------------------------------------------------------
XML_INPUT_STR := INPUT_VAL.getstringval();
--te := '<exec_Running_Totals_Root>' || XML_INPUT_STR || '</exec_Running_Totals_Root>'; 
te := CONCAT('<exec_Running_Totals_Root>' , XML_INPUT_STR);
te := CONCAT(te , '</exec_Running_Totals_Root>');
DBMS_OUTPUT.PUT_LINE(te);
XML_INPUT_VAL := new XMLTYPE(te);
--------------------------------------------------------

FOR r IN
      (SELECT ExtractValue(Value(p),'/exec_Running_Totals/fin_inst_cd/text()') AS  FIN_INST_CD,
      Extract(Value(p),'/exec_Running_Totals/exec_summary_id/text()').getnumberval() As EXEC_SUMMARY_ID,
      Extract(Value(p),'/exec_Running_Totals/acc_num/text()') As ACC_NUM,
      Extract(Value(p),'/exec_Running_Totals/acc_currency/text()') As ACC_CURRENCY,
      Extract(Value(p),'/exec_Running_Totals/available_amt/text()').getnumberval() As AVAILABLE_AMT,
      Extract(Value(p),'/exec_Running_Totals/creation_date/text()') As CREATION_DATE
      FROM TABLE(XMLSequence(Extract(INPUT_VAL,'/exec_Running_Totals_Root/exec_Running_Totals'))) p)

      LOOP
   begin

 IF NOT(EXEC_SUMMARY_ID_INPUT = 0)
 THEN
    exec_Summary_Id_Val := EXEC_SUMMARY_ID_INPUT;
 ELSE
    exec_Summary_Id_Val := r.EXEC_SUMMARY_ID;
 END IF;

    EXEC_SUMMARY_ID,
    FIN_INST_CD,
    ACC_NUM,
    ACC_CURRENCY,
    AVAILABLE_AMT,
    CREATION_DATE
  )
  VALUES
  (
    exec_Summary_Id_Val,
    r.FIN_INST_CD,
    r.ACC_NUM,
    r.ACC_CURRENCY,
    r.AVAILABLE_AMT,
    to_date(r.CREATION_DATE,'YYYY-MM-DD HH24:MI:SS')
  );

  end;
  END LOOP;

DBMS_OUTPUT.PUT_LINE('INSERT_EXEC_RUNNING_TOTAL_SP ends');
EXCEPTION
  WHEN OTHERs THEN
      Raise_application_error(-20322, 'UNKNOWN ERROR>>'|| SQLERRM); 

END INSERT_EXEC_RUNNING_TOTAL_SP;

