/
--------------------------------------------------------
--  DDL for Procedure SLA_INIT_TMPL_SP
--------------------------------------------------------
set define off;

  CREATE OR REPLACE EDITIONABLE PROCEDURE "TANFEETH"."SLA_INIT_TMPL_SP" 
(P_TMPL_CODE IN VARCHAR2, P_CH_ID IN VARCHAR2, P_LVL IN INTEGER, P_CYCLE IN VARCHAR2, P_SLA_PERIOD IN INTEGER)
AS

        TYPE WORKING_DAYS IS TABLE OF DATE;
        WORKING_DAYS_LIST WORKING_DAYS;


        TYPE HOLIDAYS IS TABLE OF INTEGER;
        HOLIDAYSLIST HOLIDAYS;


        L_NXT_WD_DATE   DATE;
        L_PRV_WD_DATE   DATE;
        TOTAL           INTEGER;
        TOTAL_WD_GENERATED INTEGER;
        DAY_OF_YEAR     INTEGER;
        DAY_OF_WEEK     INTEGER;
        ISHOLIDAY       BOOLEAN;
        ISWEEKEND       BOOLEAN;

        L_PERIOD_START_DATE     DATE;
        L_PERIOD_END_DATE       DATE;
        L_LAST_WORKING_DATE     DATE;
        WORKING_HOURS_START     NUMBER;
        WORKING_HOURS_END       NUMBER;
        WORKING_MINUTES         NUMBER;
        DUE_DAYS_SHIFT          INTEGER;
        DUE_MINUTES_SHIFT       INTEGER;


        L_TMPL_CODE	VARCHAR2(3);
        L_CH_ID         VARCHAR2(10);
        L_LVL           INTEGER;
        L_CYCLE         VARCHAR2(10);
        SLA_PERIOD      INTEGER;

        L_PRV_CLOSE     DATE;
        L_SOB           DATE;
        L_COB           DATE;
        L_SOB_DUE       DATE;
        L_SOB_DUE_CLOSE DATE;
        L_COB_DUE_START DATE;


BEGIN
        --------------------------------------------------------------------------
        --------------------------GENERATION FROM/TO -----------------------------
        --------------------------------------------------------------------------
        L_PERIOD_START_DATE   :=      SYSDATE;
        DBMS_OUTPUT.PUT_LINE('>>PERIOD START DATE: '||L_PERIOD_START_DATE);

        L_PERIOD_END_DATE     :=      SYSDATE+1;
        DBMS_OUTPUT.PUT_LINE('>>PERIOD END DATE: '||L_PERIOD_END_DATE);

        WORKING_HOURS_START   :=      9/24;
        WORKING_HOURS_END     :=      17/24;


        --------------------LOADING HOLIDAYS IN GENERATION PERIOD-----------------------

        SELECT (TO_CHAR(day,'YY')||TO_CHAR(day,'DDD')) BULK COLLECT into HOLIDAYSLIST  FROM SLA_HOLIDAYS where day > trunc(L_PERIOD_START_DATE-100) ;
        --DBMS_OUTPUT.PUT_LINE('HOLIDAYSLIST.count: '||HOLIDAYSLIST.count);

        WORKING_MINUTES       :=      60*24*(WORKING_HOURS_END - WORKING_HOURS_START);
        --DBMS_OUTPUT.PUT_LINE('WORKING_MINUTES: '||WORKING_MINUTES);

        TOTAL := TRUNC (L_PERIOD_END_DATE, 'DD') - TRUNC (L_PERIOD_START_DATE, 'DD')+1;  
        --DBMS_OUTPUT.PUT_LINE('TOTAL: '||TOTAL);


              /*
                L_TMPL_CODE     :=      '00' ;
                L_CH_ID         :=      'P' ;
                L_LVL           :=      1 ;
                L_CYCLE         :=      'FI' ;
                SLA_PERIOD      :=      600;
               */

                L_TMPL_CODE             :=      P_TMPL_CODE  ;
                L_CH_ID                 :=      P_CH_ID ;
                L_LVL                   :=      P_LVL ;
                L_CYCLE                 :=      P_CYCLE ;
                SLA_PERIOD              :=      P_SLA_PERIOD;

                DBMS_OUTPUT.PUT_LINE (L_TMPL_CODE||'|'||L_CH_ID||'|'||L_LVL||'|'||L_CYCLE||'|'||SLA_PERIOD);            

                DUE_DAYS_SHIFT        :=      TRUNC(SLA_PERIOD/WORKING_MINUTES);
                --DBMS_OUTPUT.PUT_LINE('DUE_DAYS_SHIFT: '||DUE_DAYS_SHIFT);

                DUE_MINUTES_SHIFT     :=      WORKING_MINUTES * ((SLA_PERIOD/WORKING_MINUTES)-DUE_DAYS_SHIFT);
                --DBMS_OUTPUT.PUT_LINE('DUE_MINUTES_SHIFT: '||DUE_MINUTES_SHIFT);

                WORKING_DAYS_LIST := WORKING_DAYS();


                L_NXT_WD_DATE := L_PERIOD_START_DATE;

                -------------------TO GET LAST WORKING DAY-----------L_LAST_WORKING_DATE--------

                FOR I IN 1 .. 100 LOOP 

                        L_LAST_WORKING_DATE := L_NXT_WD_DATE-I;

                        DAY_OF_WEEK         := TO_CHAR(L_LAST_WORKING_DATE,'D');
                        DAY_OF_YEAR       := (TO_CHAR (L_LAST_WORKING_DATE, 'YY')||TO_CHAR (L_LAST_WORKING_DATE, 'DDD'));

                        ISWEEKEND := DAY_OF_WEEK=6 OR DAY_OF_WEEK=7;

                        ISHOLIDAY := DAY_OF_YEAR MEMBER OF HOLIDAYSLIST ;

                        EXIT WHEN NOT (ISHOLIDAY OR ISWEEKEND);

                END LOOP;

                --DBMS_OUTPUT.PUT_LINE('L_LAST_WORKING_DATE: '||L_LAST_WORKING_DATE);

                -------------------TO GET REQUIRED WORKING DAYS TO BE GENERATED -----------TOTAL_WD_GENERATED--&--WORKING_DAYS_LIST---

                FOR I IN 1 .. TOTAL LOOP 


                        DAY_OF_WEEK         := TO_CHAR(L_NXT_WD_DATE,'D');
                        DAY_OF_YEAR       := (TO_CHAR (L_NXT_WD_DATE, 'YY')||TO_CHAR (L_NXT_WD_DATE, 'DDD'));

                        ISWEEKEND := DAY_OF_WEEK=6 OR DAY_OF_WEEK=7;

                        ISHOLIDAY := DAY_OF_YEAR MEMBER OF HOLIDAYSLIST ;

                        IF NOT (ISHOLIDAY OR ISWEEKEND) 
                        THEN
                                WORKING_DAYS_LIST.EXTEND(1);
                                WORKING_DAYS_LIST((WORKING_DAYS_LIST.COUNT)) := L_NXT_WD_DATE; 
                        END IF;


                        L_NXT_WD_DATE := L_NXT_WD_DATE+1;

                END LOOP;   

                TOTAL_WD_GENERATED	:= WORKING_DAYS_LIST.COUNT+1;
                DBMS_OUTPUT.PUT_LINE('>>>total generated working days: '||total_WD_generated);
                --DBMS_OUTPUT.PUT_LINE('>>>DUE_DAYS_SHIFT: '|| DUE_DAYS_SHIFT);

                -------------------TO GET NEXT WORKING DAYS TO LAST DUE DATE AFTER GENERATION PERIOD-----------
                --------------------------------WORKING_DAYS_LIST+DUE_DAYS_SHIFT-------------------------------

                FOR I IN 1 .. 200 LOOP 

                        DAY_OF_WEEK         := TO_CHAR(L_NXT_WD_DATE,'D');
                        DAY_OF_YEAR       := (TO_CHAR (L_NXT_WD_DATE, 'YY')||TO_CHAR (L_NXT_WD_DATE, 'DDD'));

                        ISWEEKEND := DAY_OF_WEEK=6 OR DAY_OF_WEEK=7;

                        ISHOLIDAY := DAY_OF_YEAR MEMBER OF HOLIDAYSLIST ;

                        IF NOT (ISHOLIDAY OR ISWEEKEND) THEN

                                WORKING_DAYS_LIST.extend(1);
                                WORKING_DAYS_LIST((WORKING_DAYS_LIST.COUNT)) := L_NXT_WD_DATE; 
                                EXIT WHEN  (WORKING_DAYS_LIST.COUNT = (TOTAL_WD_GENERATED + DUE_DAYS_SHIFT+1));
                       END IF;
                        L_NXT_WD_DATE := L_NXT_WD_DATE+1;

                END LOOP;

                --DBMS_OUTPUT.PUT_LINE('L_LAST_WORKING_DATE: '||L_LAST_WORKING_DATE);

                -------------------TO FILL DB-----------------------

                DELETE FROM SLA_TMPL WHERE TMPL_CODE = L_TMPL_CODE AND CYCLE = L_CYCLE AND CH_ID = L_CH_ID AND LVL = L_LVL ;

                FOR K IN 1 .. (TOTAL_WD_GENERATED ) LOOP 

                        DBMS_OUTPUT.PUT_LINE('>>>GENERATED DATE: '||WORKING_DAYS_LIST(K));

                        IF K=1 THEN
                                L_PRV_CLOSE     :=      TRUNC(L_LAST_WORKING_DATE)+WORKING_HOURS_END;
                        ELSE
                                L_PRV_CLOSE     :=      TRUNC(WORKING_DAYS_LIST(K-1))+WORKING_HOURS_END;
                        END IF;

                        L_SOB   :=      TRUNC(WORKING_DAYS_LIST(K))+WORKING_HOURS_START ;
                        L_COB   :=      TRUNC(WORKING_DAYS_LIST(K))+WORKING_HOURS_END;

                        L_SOB_DUE :=    TRUNC(WORKING_DAYS_LIST(K+DUE_DAYS_SHIFT))+WORKING_HOURS_START+(DUE_MINUTES_SHIFT/60/24) ;
                        L_SOB_DUE_CLOSE :=TRUNC(WORKING_DAYS_LIST(K+DUE_DAYS_SHIFT))+WORKING_HOURS_END;
                        L_COB_DUE_START :=TRUNC(WORKING_DAYS_LIST(K+DUE_DAYS_SHIFT+1))+WORKING_HOURS_START ;

                        DBMS_OUTPUT.PUT_LINE('   PRV_CLOSE:'||TO_CHAR(L_PRV_CLOSE, 'YYYY-MM-DD HH24:MI:SS')||', SOB:'||TO_CHAR(L_SOB, 'YYYY-MM-DD HH24:MI:SS')||', COB:'||TO_CHAR(L_COB, 'YYYY-MM-DD HH24:MI:SS')||', SOB_DUE:'||TO_CHAR(L_SOB_DUE, 'YYYY-MM-DD HH24:MI:SS')||', SOB_DUE_CLOSE:'||TO_CHAR(L_SOB_DUE_CLOSE, 'YYYY-MM-DD HH24:MI:SS')||', COB_DUE_START:'||TO_CHAR(L_COB_DUE_START, 'YYYY-MM-DD HH24:MI:SS'));


                END LOOP;   

        COMMIT;  

/* 
---------------------the query to get SLA value---------------------- 
  SELECT
    CASE
        WHEN INSTR((P7 - SOB_DUE_CLOSE),'-')=0
        THEN (P7 - (SOB_DUE_CLOSE - COB_DUE_START))
        ELSE P7
    END AS DUE_Date
FROM
    SLA_TMPL_VIEW SLA
    where
    TMPL_CODE=(select TMPL_CODE from SLA_SRV_TMPL where SRV_CODE='02')
        AND CYCLE='FI'
        AND CH_ID='B'
        AND LVL=0

     ;
  */

END;

