--  DDL for Function GET_SLA_DUEDATE
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE FUNCTION "TANFEETH"."GET_SLA_DUEDATE" 
(
  SRV_CODE_VAR IN VARCHAR2 
, CYCLE_VAR IN VARCHAR2 
, CH_ID_VAR IN VARCHAR2 
, LVL_VAR IN VARCHAR2 
) RETURN DATE AS 
DUEDATE_VAR varchar2(256);

BEGIN

SELECT
    CASE
        WHEN INSTR((P7 - SOB_DUE_CLOSE),'-')=0
        THEN (P7 - (SOB_DUE_CLOSE - COB_DUE_START))
        ELSE P7
    END AS DUE_Date into DUEDATE_VAR
FROM
    SLA_TMPL_VIEW SLA
    where
    TMPL_CODE=(select TMPL_CODE from SLA_SRV_TMPL where SRV_CODE=SRV_CODE_VAR)
        AND CYCLE=CYCLE_VAR
        AND CH_ID=CH_ID_VAR
        AND LVL=LVL_VAR;

  RETURN DUEDATE_VAR;
END GET_SLA_DUEDATE;

